ong the Eastern Seaboard. New Jersey is one of the smallest states in area, but it is highly urbanized and has one of the country\\u2019s highest population densities. Hundreds of thousands of its citizens commute to New York and Pennsylvania. New Jersey\\u2019s transportation system is one of the busiest and most extensive in the world, and it weaves the state into the fabric of the region by funneling goods and people to New York City and other points north and to Philadelphia and points south. For hundreds of thousands of visitors it offers long stretches of fine beaches along the Atlantic Ocean, and the resort town of Atlantic City may be better known than the state itself.\",\"title_color\":\"#727272\",\"typography_typography\":\"custom\",\"typography_font_family\":\"DM Sans\",\"typography_font_size\":{\"unit\":\"px\",\"size\":16,\"sizes\":[]},\"typography_font_weight\":\"400\",\"typography_line_height\":{\"unit\":\"px\",\"size\":26,\"sizes\":[]},\"_margin\":{\"unit\":\"px\",\"top\":\"40\",\"right\":\"0\",\"bottom\":\"0\",\"left\":\"0\",\"isLinked\":false}},\"elements\":[],\"widgetType\":\"heading\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"4090233f\",\"elType\":\"container\",\"settings\":{\"flex_direction\":\"row\",\"flex_gap\":{\"unit\":\"px\",\"size\":0}},\"elements\":[{\"id\":\"24b01ba8\",\"elType\":\"container\",\"settings\":{\"flex_direction\":\"column\",\"content_width\":\"full\",\"width\":{\"unit\":\"%\",\"size\":\"\"}},\"elements\":[{\"id\":\"7b406f60\",\"elType\":\"widget\",\"settings\":{\"title\":\"New Jersey\",\"align\":\"center\",\"typography_typography\":\"custom\",\"typography_font_family\":\"DM Sans\",\"typography_font_size\":{\"unit\":\"px\",\"size\":36,\"sizes\":[]},\"typography_font_weight\":\"700\",\"typography_line_height\":{\"unit\":\"px\",\"size\":46,\"sizes\":[]},\"_margin\":{\"unit\":\"px\",\"top\":\"0\",\"right\":\"0\",\"bottom\":\"50\",\"left\":\"0\",\"isLinked\":false},\"typography_font_size_tablet\":{\"unit\":\"px\",\"size\